('1973','18','7661','Villa Palmer',Null,'Architektenvilla mit schönem Garten in Santa Ponsa','25122','Diese zweigeschossige Komfortvilla mit einer Wohnfläche von 300 m² vereint klassische und moderne Stilelemente und besitzt eine nahezu ebenes, gärtnerisch mit mediterranen Pflanzen aufwendig angelegtes Grundstück von 1.150 m². Die Villa ist wie folgt aufgeteilt: Wohn-/Esszimmer, amerikanische Küche, 4 Schlafzimmer, 3 Bäder (1 en suite), Wirtschaftsraum. Doppelt verglaste Kunststofffenster,\r\nFußbodenheizung,  eine Doppelgarage, freie und überdachte Terrassen mit Grill sowie ein Schwimmbad komplettieren das Angebot. Die Villa kann auch für 4.500€ / Monat, plus 130€ Pool und Gartenpflege angemietet werden. Die Maklergebühr von 1,5 fachen einer Monatsmiete zahlt der Mieter.','25123','1350000','111','2013-03-04 16:10:29','110','2013-03-04 16:11:04',Null,'1740','121','834',1,'1','0',Null,Null,Null,'25124',Null,'0','0','0',Null,'2015-04-14 15:10:45',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'25125',Null,'25126',Null,'25127',Null,'25128',Null,'25129','0',0,'0');
